  false,\n\t\"url\": null,\n\t\"notes\": \"A downward-looking moored ADCP instrument
  was deployed at the surface about a mile south of Honolulu Harbor in waters of about
  280 feet. The instrument was in operation from May 1997 - August 1998, when it was
  tangled in the mooring line of a ship and made unoperational. The data are one-minute
  samples taken from 20 to 62 m at 2 m depth intervals. Primary processing was done
  by Oceanit. Michelle Eich, a graduate student at the University of Hawaii, applied
  quality control to select time periods of the data. Some of the other periods have
  remaining questionable features.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
